import './Admin_login.css';
import { Navbar,Nav,Form,Table,Carousel,Button,Card } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';
import { useState } from 'react';
function App() {
  const [email,setemail]=useState('');
  const [password,setpassword]=useState('');
  return (
   <div className="Admin">
       <Link to="/"><Button variant="primary" className="but">Home</Button></Link>
       <div className="Guns">
       <Card border="dark" style={{ width: '30rem' }}>
           <Card.Body>
       <Card.Title>Admin LOGIN</Card.Title>
     <Form>
  <Form.Group controlId="formBasicEmail">
    <Form.Label>Email address</Form.Label>
    <Form.Control type="email" placeholder="Enter email" />
    <Form.Text className="text-muted">
      We'll never share your email with anyone else.
    </Form.Text>
  </Form.Group>
  <Form.Group controlId="formBasicPassword">
    <Form.Label>Password</Form.Label>
    <Form.Control type="password" placeholder="Password" />
  </Form.Group>
  <Link to="/ahome"><Button variant="primary" type="submit">
    Submit
  </Button></Link>
<Card.Link href="#" className="llink">Forgot password</Card.Link>
</Form>
</Card.Body>
</Card>
  </div>
  </div>
  );
}

export default App;
